using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.ComponentModel;
using System.Xml.Linq;

namespace pfVisualisator
{
    public class vOKPReport : myleo, INotifyPropertyChanged
    {
        // Declare the event
        public event PropertyChangedEventHandler PropertyChanged;

        private int pictureindex;

        public vOKPReport()
            : base( leoType.OKPReport )
        {
            string[] akva = new string[5];
            ltexto = akva.ToList();
            lpicto = new List<mypict>();
            pictureindex = 0;
        }

        public vOKPReport(Guid gvido, string[] maso)
            : this() {
            Namo = maso[0];
            bignamo = maso[1];
            OrBaseComment = maso[2];
            Descripto = maso[3];
            ScriptFileName = maso[4];
            SQuery = maso[5];
            SUid = gvido.ToString();
            }

        public vOKPReport(XElement Elemo)
            : base(Elemo)
        {
            pictureindex = 0;
        }

        #region--------------------------Свойства отчета-----------------------------------------
        public string Namo { get { return namo; } set { namo = value; } }
        public string BigNamo { get { return bignamo; } set { bignamo = value; } }
        public string OrBaseComment { get { return ltexto[0]; } set { ltexto[0] = value; } }
        public string Descripto { get { return ltexto[1]; } set { ltexto[1] = value; } }
        public string ScriptFileName { get { return ltexto[2]; } set { ltexto[2] = value; } }
        public string SQuery { get { return ltexto[3]; } set { ltexto[3] = value; } }
        public string SUid { get { return ltexto[4]; } set { ltexto[4] = value; } }
        public myTago Tago { get { return tago; } }
        public string TagoTextStroke { get { return tago.TStroke; } }
        public bool HasBinoRepoData { get { return GetBinoRepoData() != null; } }
        public mybino BinoRepoInfo { get { return GetBinoRepoData(); } }
        #endregion-----------------------Свойства отчета-----------------------------------------
        #region--------------------------Картиночные свойства-----------------------------------------
        public List<mypict> Lpictures { get { return lpicto; } }
        public mypict SamoPicture { get { return lpicto.Count == 0 ? null : lpicto[pictureindex]; } }
        public byte[] CurPicture { get { return lpicto.Count == 0 ? null : lpicto[pictureindex].Picture; } }
        public string CurPictDescription { get { return lpicto.Count == 0 ? "Нет картинки" : lpicto[pictureindex].Commento; }
                                           set { if(lpicto.Count > 0) lpicto[pictureindex].Commento = value; } }
        public int PicCount { get { return lpicto.Count; } }
        public int PicCurrent { get { return (lpicto.Count > 0) ? pictureindex + 1 : 0; } }
        #endregion-----------------------Картиночные свойства-----------------------------------------



        /// <summary>
        /// Модификация от 15 января 2015 года
        /// Заложен от 15 января 2015 года
        /// </summary>
        /// <param name="sdvigo"></param>
        public void PicturePositionChange(int sdvigo)
        {
            int newpos = pictureindex + sdvigo;
            if (newpos < 0 || newpos >= lpicto.Count) { return; }
            pictureindex = newpos;
            OnPropertyChanged("CurPicture");
            OnPropertyChanged("PicCurrent");
            OnPropertyChanged("CurPictDescription");
        }

        /// <summary>
        /// Модификация от 27 января 2015 года
        /// Заложен от 27 января 2015 года
        /// </summary>
        public void PictureDelete() {
            if (PicCount > 0) {
                lpicto.RemoveAt(pictureindex);
                }
            OnPropertyChanged("CurPicture");
            OnPropertyChanged("PicCurrent");
            OnPropertyChanged("CurPictDescription");
            OnPropertyChanged("PicCount");
        }

        /// <summary>
        /// Модификация от 14 мая 2015 года
        /// Заложен 14 мая 2015 года
        /// </summary>
        /// <returns></returns>
        private mybino GetBinoRepoData() {
            mybino reto = null;
            if( LeoBinoList != null ) {
                foreach( mybino aa in LeoBinoList ) {
                    if( aa.FiloNamo.StartsWith("ОКПBaseReport") ) {
                        reto = aa;
                        break;
                        }
                    }
                }
            return reto;
            }

        private void OnPropertyChanged(string name)
        {
            PropertyChangedEventHandler handler = PropertyChanged;
            if (handler != null)
            {
                handler(this, new PropertyChangedEventArgs(name));
            }
        }


