    }

    public class vLRepo : INotifyPropertyChanged
    {
        // Declare the event
        public event PropertyChangedEventHandler PropertyChanged; 

        private List<vOKPReport> manolist = vRepoList.Listo;
        private bool edina = vRepoList.Edina;

        /// <summary>
        /// Модификация от 8 января 2015 года
        /// Заложен 8 января 2015 года
        /// </summary>
        /// <param name="deystvo"></param>
        public vLRepo(int deystvo) {
            if(deystvo == 1) {
                if(manolist.Count == 0) {
                    string typo = Properties.Settings.Default.xmlORbase;
                    if(typo == "xml") {
                        string flo = Properties.Settings.Default.xmlFailo;
                        XDocument doca = XDocument.Load(flo);
                        vRepoList.FillListFromXML(doca.Element("Reportys").Elements("Leo").ToList());
                        }
                    else if(typo == "baso") {
                        bido basa = new bido();
                        List<XElement> lxe = basa.GetListRepoXML();
                        vRepoList.FillListFromXML(lxe);
                        }
                    }
                }
            }

        public string AddNewObject(Guid kluch, string[] seta)
        {
            string sret = vRepoList.AddNewObject(kluch, seta);
            if (sret == string.Empty)
            {
                OnPropertyChanged("Listo");
            }
            return sret;
        }

        /// <summary>
        /// Сохраняет текущий список отчетов в источнике (либо база, либо xml-файл)
        /// Модификация от 26 января 2015 года
        /// Заложен 8 января 2015 года
        /// </summary>
        /// <param name="ptypo">xml или baso</param>
        public void SavoList(string ptypo) {
            if (ptypo == "xml") {
                string flo = Properties.Settings.Default.xmlFailo;
                this.SavoInXmlFilo(flo);
            } else if (ptypo == "baso") {
                bido basa = new bido();
                foreach( vOKPReport tt in manolist ) {
                    basa.PutLeoRecord(tt);
                    }
                }
            }

        /// <summary>
        /// Сохраняет текущий список отчетов в источнике (либо база, либо xml-файл)
        /// Модификация от 26 января 2015 года
        /// Заложен 26 января 2015 года
        /// </summary>
        /// <param name="repogvid">ОКП-шный гвид</param>
        public void SavoElement(Guid repogvid) {
            string typo = Properties.Settings.Default.xmlORbase;
            if (typo == "xml") {
                string flo = Properties.Settings.Default.xmlFailo;
                this.SavoInXmlFilo(flo);
            } else if (typo == "baso") {
                bido basa = new bido();
                vOKPReport sv = vRepoList.GetRepoOnGvid(repogvid);
                if (sv != null) {
                    basa.PutLeoRecord(sv);
                    }
                }
            }

        /// <summary>
        /// Модификация от 8 января 2015 года
        /// Заложен 8 января 2015 года
        /// </summary>
        /// <param name="filo"></param>
        private void SavoInXmlFilo(string filo) {
            XComment xcom = new XComment(string.Format("Отчётики от {0} ", DateTime.Now.ToLongDateString()));
            XDocument doca = new XDocument(new XDeclaration("1.0", "utf-8", "yes"), xcom);
            XElement ruta = new XElement("Reportys");
            foreach (vOKPReport aa in manolist) {
                ruta.Add(aa.LeoToXML());
                }
            doca.Add(ruta);
            doca.Save(filo);
            }

        private void OnPropertyChanged(string name)
        {
            PropertyChangedEventHandler handler = PropertyChanged;
            if (handler != null)
            {
                handler(this, new PropertyChangedEventArgs(name));
            }
        }

        public bool Edina { set { vRepoList.Edina = value; } get { return edina; } }
        public List<vOKPReport> Listo { get { return manolist; } }

    }

    public class vRepoList : Singleton<vRepoList>
    {

        private vRepoList() { }

        private static List<vOKPReport> manolist = new List<vOKPReport>();
        private static Dictionary<Guid, vOKPReport> dictonar = new Dictionary<Guid, vOKPReport>();
        private static bool edina = false;
        private static vOKPReport currepo = null;

        /// <summary>
        /// Модификация от 19 декабря 2014 года
        /// Заложен 17 декабря 2014 года
        /// </summary>
        /// <returns></returns>
        public static void FillListFromZago() {
            vOKPReport tema;
            Guid qu;

            tema = vOKPReport.ZagoCreate();
            qu = Guid.Parse(tema.SUid);
            dictonar.Add(qu, tema);
            manolist.Add(tema);
            tema = vOKPReport.ZagoTwoCreate();
            qu = Guid.Parse(tema.SUid);
            dictonar.Add(qu, tema);
            manolist.Add(tema);
            }

        /// <summary>
        /// Модификация от 8 января 2015 года
        /// Заложен 8 января 2015 года
        /// </summary>
        /// <param name="lxe"></param>
        public static void FillListFromXML(List<XElement> lxe) {
            vOKPReport tema;
            Guid qu;

            foreach (XElement aa in lxe) {
                tema = new vOKPReport(aa);
                qu = Guid.Parse(tema.SUid);
                dictonar.Add(qu, tema);
                manolist.Add(tema);
                }
            }

        /// <summary>
        /// Модификация от 18 декабря 2014 года
        /// Заложен 18 декабря 2014 года
        /// </summary>
        /// <param name="kluch">GUID добавляемого нового отчета</param>
        /// <param name="seta">Набор строк, содержащий всю его сущность</param>
        /// <returns>Пустая строка при успехе. Текст ошибки в противном случае.</returns>
        public static string AddNewObject(Guid kluch, string[] seta) {
            string sret = string.Empty;
            if (dictonar.ContainsKey(kluch)) {
                sret = "Отчёт с таким ГУИДом уже есть в нашем списке.";
            } else {
                vOKPReport tema = new vOKPReport(kluch, seta);
                dictonar.Add(kluch, tema);
                manolist.Add(tema);
                }
            return sret;
            }

        /// <summary>
        /// Модификация от 14 января 2015 года
        /// Заложен 14 января 2015 года
        /// </summary>
        /// <param name="aa"></param>
        public static void SetCurrentRepo(vOKPReport aa) {
            if (dictonar.ContainsValue(aa)) {
                currepo = aa;
            } else {
                //НОНСЕНС
                throw new RepoException("Попытка установить текущим репортом отсутствующий в словаре репортов");
                }
            }

        /// <summary>
        /// Модификация от 26 января 2015 года
        /// Заложен от 26 января 2015 года
        /// </summary>
        /// <param name="aa"></param>
        /// <returns></returns>
        public static vOKPReport GetRepoOnGvid(Guid aa) {
            vOKPReport reto = null;
            if( dictonar.ContainsKey(aa) ) {
                reto = dictonar[aa];
                }
            return reto;
            }

        /// <summary>
        /// Модификация от 15 января 2015 года
        /// Заложен от 15 января 2015 года
        /// </summary>
        /// <param name="aa"></param>
        public static void AddNewPicture(mypict aa) {
            currepo.Lpictures.Add(aa);
            }

        public static bool Edina { set { edina = value; } get { return edina; } }
        public static List<vOKPReport> Listo { get { return manolist; } }
        }

    public class RepoException : Exception
    {
        public RepoException()
        {
        }
        public RepoException(string message)
            : base(message)
        {
        }
        public RepoException(string message, Exception inner)
            : base(message, inner)
        {
        }
    }

}
